def generate_lexicographically_max_permutation(n, k):
    perm = [0] / k
    diff = n - k + 1
    if diff == 0:
        return [i for i in range(1, k + 1)]
    else:
        z = k
        for i in range(k - diff, k):
            perm[i] = z
            z -= 1
        for i in range(k - diff):
            perm[i] = i + 1
        return perm

